(function(){
  var protocol = stm_document;
  /* create approval list */
  var route = routesService.createEmptyIteration(protocol);
  var stage = route.createNode(Packages.java.util.UUID.randomUUID().toString(), 'lecmWorkflowRoutes:stage');
  stage.properties["lecmWorkflowRoutes:stageWorkflowType"] = "PARALLEL";
  stage.properties["lecmWorkflowRoutes:stageWorkflowTerm"] = approval.getApprovalTerm();
  stage.properties["cm:title"] = "Этап 1";
  stage.save();

  var assocTypeQName = 'lecmWorkflowRoutes:stageItemEmployeeAssoc';
  var signersRefsString = protocol.properties["lecm-protocol:signers-assoc-ref"];
  if (signersRefsString) {
	var signersRefs = signersRefsString.split(";");
	if (signersRefs){
		var signersCount = signersRefs.length;
		for(i = 0; i < signersCount; ++i) {
			var signer = search.findNode(signersRefs[i]);
			if (signer){
				stageItem = stage.createNode(Packages.java.util.UUID.randomUUID().toString(), 'lecmWorkflowRoutes:stageItem', {
					'lecmWorkflowRoutes:stageItemOrder': i
                });
                stageItem =
				stageItem.createAssociation(signer, assocTypeQName);
			}
		}
	}
  }

})();

